import React from 'react';
import { connect } from 'react-redux';
import { logIn, logOut } from '../../redux/actions'
import '../../App.css';
import UpperLine from '../../components/UpperLine';
import NavBar from '../../components/NavBar';
import AdSpace from '../../components/AdSpace';
import Header from '../../components/Header';
import Bottom from '../../components/Bottom';
import BreadCrumbs from '../../components/BreadCrumbs';



class ContentSupport extends React.Component {

  render() {

    return (
      <div className="App">
        <UpperLine/>
        <Header/>
        <NavBar/>
        <BreadCrumbs pathname = {this.props.location.pathname}/>
        <div style = {{textAlign: 'center'}}>
            <button className = 'support_btn'>VPRAŠANJE V ZVEZI S PRODAJO</button>
            <button className = 'support_btn'>VPRAŠANJE V ZVEZI Z NAKUPOM</button>
            <button className = 'support_btn'>REKLAMACIJA IZDELKA</button>
        </div>
        <AdSpace/>
        <Bottom/>
      </div>
    );

  }

}

const mapStateToProps = state => {
    return {
      loggedInUser: state.loggedInUser,
      loggedInUserId: state.loggedInUserId,
    };
  };

  const mapDispatchToProps = {
    logIn: logIn,
    logOut: logOut
  };

export default connect(mapStateToProps, mapDispatchToProps) (ContentSupport);
